// macro for array length calculation
#define DIM(a) (sizeof(a) / sizeof(a[0]))

// class for cells array managing
class CellDB {
public:
  CellDB() : cells(AllCells, AllCells + DIM(AllCells)) {}

  // return i-th cell
  Cell operator[](int i) const { return cells[i]; }
  // number of cells in database
  int size() const { return cells.size(); }

  // select cells for which "par" == "val"
  template <typename T>
  CellDB find(const std::string par, const T val) const {
    std::vector<Cell> s;
    for (size_t i = 0; i < cells.size(); ++i)
      if (cells[i].check(par, val))
        s.push_back(cells[i]);
    return CellDB(s);
  }

private:
  CellDB(const std::vector<Cell> s) : cells(s) {}
  std::vector<Cell> cells;
};
